import React, {useState} from "react";
import "./App.css";



function PatchAthlete ({ athleteId }) {

    console.log(`Athlete Id: ${athleteId}`)


    const [patchFormData, setPatchFormData] = useState({
        name: "",
        age: ""
    })

    console.log(patchFormData)

    function handleFormChange(e) {
       setPatchFormData({...patchFormData,
        [e.target.name]: e.target.value})
    }

    return (
        <form onSubmit={handleFormSubmit} className="new_comment">
            <label htmlFor="name">
                name: 
                <input value={patchFormData.name} onChange={handleFormChange} type="text" name="name" />
            </label><br/>
            <label htmlFor="rating">
                age: 
                <input value={patchFormData.age} onChange={handleFormChange} type="number" name="age" min="1" />
            </label>
            <input type="submit" value="Submit" />
        </form>
    )
}

export default PatchAthlete
